// Function to get product image by slug
export function getProductImage(slug, fallbackIndex = 0) {
	if (productImageMap[slug]) {
		return productImageMap[slug];
	}

	// Create a hash from the slug to get a consistent but different image for each product
	const slugHash = slug.split("").reduce((acc, char) => acc + char.charCodeAt(0), 0);

	// Try to extract category from slug or use fallback
	const categories = Object.keys(categoryImages);
	const categoryIndex = slugHash % categories.length;
	const categoryImagesList = categoryImages[categories[categoryIndex]];

	if (categoryImagesList && categoryImagesList.length > 0) {
		const imageIndex = slugHash % categoryImagesList.length;
		return categoryImagesList[imageIndex];
	}

	return null;
}

