export function getPremiumPlaceholder(type = "sports", slug = "") {
	const placeholders = premiumPlaceholders[type] || premiumPlaceholders.sports;

	// Create a hash from the slug to get a consistent but different image for each product
	const slugHash = slug ? slug.split("").reduce((acc, char) => acc + char.charCodeAt(0), 0) : 0;
	const imageIndex = slugHash % placeholders.length;

	return placeholders[imageIndex];
}
